// You have 6 types of coins with values 1, 2, 5, 10, 20 and 50 cents. Write an algorithm on C# to find all combinations giving 100 cents (one dollar)
// -------------------------- Coins -------------------------------------------------
using System;
using System.Collections.Generic;

public class CoinCombinations
{
    private static readonly int[] Coins = 
        { 1, 2, 5, 10, 20, 50 };
    private static readonly List<List<int>> Combinations = 
        new List<List<int>>();

    public static void Main()
    {
        FindCombinations(new List<int>(), 100);
        foreach (var combination in Combinations)
        {
            Console.WriteLine(string.Join(" ", combination));
        }
    }

    public static void FindCombinations(List<int> currentCombination, int remaining)
    {
        if (remaining == 0)
        {
            Combinations.Add(new List<int>(currentCombination));
            return;
        }

        if (remaining < 0)
        {
            return;
        }

        for (int i = 0; i < Coins.Length; i++)
        {
            if (currentCombination.Count == 0 || Coins[i] >= currentCombination[currentCombination.Count - 1])
            {
                currentCombination.Add(Coins[i]);
                FindCombinations(currentCombination, remaining - Coins[i]);
                currentCombination.RemoveAt(currentCombination.Count - 1);
            }
        }
    }
}

#include <iostream>

int main()
{
    int n = 0;
    
    std::cin >> n;
    
    int** A = new int*[n];
    
    for (int z = 0; z < n; ++z) {
        A[z] = new int[2];
    }
    
    for (int y = 0; y < n; ++y) {
        std::cin >> A[y][0] >> A[y][1];
    }
            
    int min_right_border = 0,
        border_limit = 0,
        count = 0;

    for (int i = 0; i < n; ++i) {
        
        min_right_border = A[i][1];
        
        if (A[i][0] < border_limit) {
            continue;
        }
        
        if (min_right_border == border_limit) {
            std::cout << "break" << std::endl;
            break;
        }
        
        for (int j = 0; j < n; ++j) {
            if (j == i) continue;
            
            if (A[j][0] >= border_limit && A[j][1] < min_right_border) {
                min_right_border = A[j][1];
            }
        }
        
        if (min_right_border != border_limit) {
            std::cout << "i = " << i << ", min_right_border = " << min_right_border << ", border_limit = " << border_limit << std::endl;
            border_limit = min_right_border;
            count++;
        }
        
        // std::cout << "i = " << i << ", min_right_border = " << min_right_border << ", border_limit = " << border_limit << std::endl;
    }
    
    for (int q = 0; q < 2; ++q)
    {
        delete[] A[q];
    }
    
    delete[] A;
    
    std::cout << count << std::endl;
    
    return 0;
}

