class GroceryReceipt extends GroceryReceiptBase {

    public GroceryReceipt(Map<String, Double> prices, Map<String, Integer> discounts) {
        super(prices, discounts);
    }

    @Override
    public List<Grocery> Calculate(List<Node> shoppingList) {
        List<Grocery> invoice = new ArrayList<>();
        
        Map<String, Double> itemPrices = getPrices();
        Map<String, Integer> itemDiscounts = getDiscounts();
        Map<String, Integer> itemCounts = new HashMap<>();

        for (Node item : shoppingList) {
            String itemName = item.fruit;
            int itemCount = item.count;
            itemCounts.put(itemName, itemCounts.getOrDefault(itemName, 0) + itemCount);
        }

        for (Map.Entry<String, Integer> entry : itemCounts.entrySet()) {
            String itemName = entry.getKey();
            int itemCount = entry.getValue();

            if (itemPrices.containsKey(itemName)) {
                double price = itemPrices.get(itemName);
                double discount = 0.0;

                if (itemDiscounts.containsKey(itemName)) {
                    int discountPercentage = itemDiscounts.get(itemName);
                    discount = (price * discountPercentage / 100) * itemCount;
                }

                double total = (price * itemCount) - discount;
                invoice.add(new Grocery(itemName, price, total));
            }
        }

        // Sort the invoice list in ascending order of product name
        invoice.sort(Comparator.comparing(grocery -> grocery.fruit));

        return invoice;
    }
}

