using namespace std;

typedef long long LL;
const int maxn = 100000 + 100;
const int m = 12;
int T, n, num;
bool ans;
LL k, sum;
char str[maxn];
int fac[m] = {1, 2, 3, 7, 11, 21, 49, 14, 22, 77, 147, 154};
int idx[200];
bool vis[m];

LL toNum(char *str) {
    LL ret = 0;
    for (int i = 0; str[i] != '\0'; ++i) {
        ret = ret * 10 + str[i] - '0';
    }
    return ret;
}

bool judge(int num, int x) {
    int g = __gcd(num, x);
    return vis[idx[x / g]];
}

int getLen(char *str) {
    for (int i = 0; i <= 19; ++i) {
        if (str[i] == '\0') {
            return i;
        }
    }
    return 18;
}

