    for (int i = 0; i < m; ++i) {
        idx[fac[i]] = i;
    }
    scanf("%d", &T);
    while (T--) {
        scanf("%d %s", &n, str);
        if (getLen(str) >= 18) {
            k = 100000000000000000LL;
        } else {
            k = toNum(str);
        }
        ans = false;
        sum = 0;
        memset(vis, 0, sizeof(vis));
        for (int i = 0; i < n; ++i) {
            scanf("%d", &num);
            sum += num;
            if (judge(num, 147) || judge(num, 154)) {
                ans = true;
            }
            for (int j = 0; j < m; ++j) {
                if (num % fac[j] == 0) {
                    vis[j] = true;
                }
            }
        }
        printf("%s\n", ((ans || sum >= k)? "Yes": "No"));
    }

    return 0;
}

